import React, { Component } from 'react';
import logo from './logo.svg';

import MapCard from "./Components/MapCard.jsx"
import NewsCard from "./Components/NewsCard.jsx"
import StatsCard from "./Components/StatsCard.jsx"
import Picker from './Components/Picker';

import './App.css';



class App extends Component {

  constructor(){
    super()
    this.state = {
      countryOptions: [],
      defaultCountryOption: 'Aruba',
      currentCountryOption: 'All',
    }
  }

  render(){
    return (
      <div className="App">
        <Picker cid={'country-menu'} options={this.state.clientOptions} value={this.state.defaultClientOption} placeholder={this.state.defaultClientOption}/>
        <MapCard></MapCard>
        <NewsCard></NewsCard>
        <StatsCard></StatsCard>
      </div>
    );
  }
}

export default App;
